import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the first "Add to Cart" button
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.click('.add-to-cart:first-of-type');

    // Wait for cart update and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_added.png'));

    // Verify cart count updated
    const cartCount = await page.textContent('.cart');
    const productTitle = await page.textContent('.product-title:first-of-type');

    return {
      success: true,
      action: "Added first product to cart",
      extractedData: {
        cartCount: cartCount.trim(),
        productTitle: productTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add product to cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
